svg.script:
   
	var myMapApp = new mapApp(false,undefined);//与tooltip相关
	var obc;//
	var ocls;
	window.onSVGLoad=initLater();
	function initLater() {
     //this timeout is because of the bbox bug in Firefox which prevents to have access to bbox in onload scripts
         window.setTimeout("init()",100);
    }
	function init() {
		  
	    /* 添加tooltip*/
        //tooltip styles
         var tooltipTextStyles = {"font-family":"Arial,Helvetica","fill":"dimgray","font-size":130};
         var tooltipRectStyles = {"fill":"white","stroke":"dimgray"};
         myMapApp.initTooltips("toolTip",tooltipTextStyles,tooltipRectStyles,10,20,3);
         //add tooltip to element
		 myMapApp.addTooltip("legend",undefined,true,false,"target","name");
		 myMapApp.addTooltip("zta",undefined,true,false,"target","name");
		
	}

	function Closeleone(){
	    
		 document.getElementById('cir1').setAttribute("style", "visibility: hidden");
	     document.getElementById('cir2').setAttribute("style", "visibility: hidden");
	     document.getElementById('cir3').setAttribute("style", "visibility: hidden");
		 document.getElementById('cir4').setAttribute("style", "visibility: hidden");
		 svgDoc.getElementById("mapIB").setAttribute("class","fil30");
		 svgDoc.getElementById("mapIA").setAttribute("class","fil30");
		 
		 svgDoc.getElementById("mapIIA").setAttribute("class","fil31");
		 svgDoc.getElementById("mapIIB").setAttribute("class","fil31");
		 
		 svgDoc.getElementById("mapIIIA").setAttribute("class","fil32");
		 svgDoc.getElementById("mapIIIB").setAttribute("class","fil32");
		 svgDoc.getElementById("mapIIIC").setAttribute("class","fil32");
		 svgDoc.getElementById("mapIIID").setAttribute("class","fil32");
		 svgDoc.getElementById("mapIIIE").setAttribute("class","fil32");
		 svgDoc.getElementById("mapIIIF").setAttribute("class","fil32");
		 svgDoc.getElementById("mapIVA").setAttribute("class","fil29");
		 svgDoc.getElementById("mapIVB").setAttribute("class","fil29");
	}
	function Closeletwo(n){
	     
		 document.getElementById("cir" + n).setAttribute("style", "visibility: visible");
		 if(n==1){
		 svgDoc.getElementById("mapIB").setAttribute("class","fil8");
		 svgDoc.getElementById("mapIA").setAttribute("class","fil7");}
		 else if (n==2){
		 svgDoc.getElementById("mapIIA").setAttribute("class","fil6");
		 svgDoc.getElementById("mapIIB").setAttribute("class","fil12");}
		 else if (n==3){
		 svgDoc.getElementById("mapIIIA").setAttribute("class","fil14");
		 svgDoc.getElementById("mapIIIB").setAttribute("class","fil16");
		 svgDoc.getElementById("mapIIIC").setAttribute("class","fil13");
		 svgDoc.getElementById("mapIIID").setAttribute("class","fil15");
		 svgDoc.getElementById("mapIIIE").setAttribute("class","fil17");
		 svgDoc.getElementById("mapIIIF").setAttribute("class","fil10");
		 }
		 else if (n==4){
		 svgDoc.getElementById("mapIVA").setAttribute("class","fil11");
		 svgDoc.getElementById("mapIVB").setAttribute("class","fil18");}
		
	}
	function Hightlight(evt) {
         var object = evt.target;
         var cls = object.id;
		 
         var objectMap = svgDoc.getElementById("map"+cls);
		 ocls = objectMap.getAttribute("class") || object.className;
         objectMap.setAttribute("class","fil000");
   }
   function Recover(evt) {
         var object = evt.target;
		 var cls = object.id;
         var objectMap = svgDoc.getElementById("map"+cls);
		 objectMap.setAttribute("class",ocls);
	}
